import React, {Component} from 'react';
import {connect} from 'react-redux';
import {Link} from 'react-router-dom';
import {fetchTimes} from "../../actions";

class PostList extends Component {
    componentDidMount() {
        this.props.fetchTimes()
    }

    renderButtons(item) {
        return (
            <div className={`right floated content`}>
                <Link to={`/timetrack/edit/${item.id}`} className={`ui button primary`}>Edit</Link>
                <Link to={`/timetrack/delete/${item.id}`} className={`ui button negative`}>Delete</Link>
            </div>
        )
    }

    renderList() {
        return this.props.timeStamp.map((item) => {
            return (
                <div className={`item`} key={item.id}>
                    {this.renderButtons(item)}
                    <div className={`content`}>
                        <div className={`header`}>
                            {item.title}
                        </div>
                        <div className={`desscription`}>
                            {item.content}
                        </div>
                        {/*<div className={`desscription`}>*/}
                        {/*{item.end_time}*/}
                        {/*</div>*/}
                    </div>
                </div>
            )
        });
    }

    // renderCreate() {
    //     return (
    //         <div>
    //             <span style={{textAlign: 'left'}}>
    //                 <Link to={`/blog/new`} className={`ui button primary`}>
    //                     Create Post
    //                 </Link>
    //             </span>
    //             <span style={{float: 'right'}}>
    //                 <Link to={`/blog/list`} className={`ui button primary`}>
    //                     Published Post
    //                 </Link>
    //             </span>
    //         </div>
    //     )
    // }

    render() {
        return (
            <div className={`item`} key={`1`}>
                <div className={`ui celled list`}>
                    {this.renderList()}
                </div>
                {/*{this.renderCreate()}*/}
            </div>
        )
    }
}

const mapStateToProps = (state) => {
    return {
        timeStamp: Object.values(state.timeStamp)
    }
};

export default connect(
    mapStateToProps,
    {fetchTimes: fetchTimes}
)
(PostList);
